function howManyDaysAgo(e,r,a,t){void 0===t&&(t=new Date);var n=new Date;n.setFullYear(Number.parseInt(e),Number.parseInt(r),Number.parseInt(a));var o=(t.getTime()-n.getTime())/864e5;if(o>365){var u=o/365;if(729>=o)var s=" year ago.";else var s=" years ago.";return Math.floor(u)+s}if(o>31){var v=o/31;if(60>=o)var s=" month ago.";else var s=" months ago.";return Math.floor(v)+s}if(o>7){var i=o/7;if(13>=o)var s=" week ago.";else var s=" weeks ago.";return Math.round(i)+s}if(o>=2){var s=" days ago.";return Math.round(o)+s}if(o>0&&1>=o){var s=" day ago.";return Math.round(o)+s}}function setDate(e,r,a){var t=new Date;return t.setFullYear(Number.parseInt(e),Number.parseInt(r),Number.parseInt(a)),t.toDateString()}